import './App.css';
import './PlantItem.js'

function DisplayList(list) {
  return (
    <div className="App">
      {list.map((item) => (
        <PlantItem 
          name={item.name}
          size={item.size}
        >
        </PlantItem>))
      }
    </div>
  );
}

export default DisplayList;
